                String getColNames (MapPhysicalNode node, ITechnology techno) {
                   // def columns = node.getLogicalComponent().getBoundObject().getColumns();
                   def columns = node.getNodeAttributes()

                   StringBuilder columnBuilder = new StringBuilder();
                   for (def column : columns) {
                      if (columnBuilder.length() > 0) {
                         columnBuilder.append(", ");
                      }
                      columnBuilder.append(getSQLAccessNameForTechno(column, techno));
                   }
                   return columnBuilder.toString();
                }

                String getColDefsFixed (MapPhysicalNode node, ITechnology techno) {
                   def columns = node.getNodeAttributes()

                   StringBuilder columnBuilder = new StringBuilder();
                   for (def column : columns) {
                      if (columnBuilder.length() > 0) {
                         columnBuilder.append(", ");
                      }
                      columnBuilder.append(getSQLAccessNameForTechno(column, techno) + " CHAR(" + column.getSize() + ")");
                   }
                   return columnBuilder.toString();
                }

                public String getSQLAccessNameForTechno(MapAttribute attribute, ITechnology techno) {
                  String result = "";

                  String attrBoundObjName = attribute.getBoundObjectName();
                  if (attrBoundObjName == null || attrBoundObjName.length() == 0) {
                     attrBoundObjName = attribute.getName();
                  }

                  ILanguage language = techno.getDefaultLanguageImpl();
                  if (language != null) {
                    char[] delimiters = language.getObjectDelimeters();
                    String name = attrBoundObjName.toUpperCase(Locale.ENGLISH);
                    boolean isCaseSensitive = language.isObjectNamesCaseSensitive();
                    boolean isReservedWord = MappingUtils.isReservedWord(techno, attrBoundObjName);
                    boolean containWordSep = false;

                    String wordSep = "";
                    char[] wordSepChars = language.getWordSeparators();
                    if (wordSepChars != null) {
                       wordSep = String.valueOf(wordSepChars);
                    }
                    wordSep += " \t\r\n";  // default word separators
                    for (char c : wordSep.toCharArray()) {
                      if (attrBoundObjName.contains(Character.toString(c))) {
                        containWordSep = true;
                        break;
                      }
                    }
                    if (containWordSep || isReservedWord || (!name.equals(attrBoundObjName) && !isCaseSensitive)) {
                      if (delimiters != null && delimiters.length == 2) {
                        attrBoundObjName = Character.toString(delimiters[0]) + attrBoundObjName + Character.toString(delimiters[1]);
                      }
                    }
                  }

                  result += attrBoundObjName;

                  return result;
                }

                String getTargetTableDDL () {
                    def targetNode = getTargetNode()
                    def targetBoundObject = targetNode.getLogicalComponent().getBoundObject()
                    def targetKeys = targetBoundObject.getKeys()
                    def field_sep = ",\n"
                    def nl = "\n"

                    def targetCols = targetNode.getNodeAttributes()

                    def targetPKCols = []
                    targetKeys.each { if (it.isPK()) { targetPKCols = it.getColumns() } }

                    def ddl = ""
                    targetCols.each {
                      ddl = ddl + it.getSQLAccessName(false,"") + " " + it.getDdlDataType()
                      if (it.isBoundAttribute() && it.getBoundObject().isMandatory()) {
                        ddl = ddl + " NOT NULL"
                      }
                      ddl = ddl + field_sep
                    }
                    def pks = ""
                    targetPKCols.each { pk ->
                      def pkSQLName = ""
                      targetCols.each {
                        if (it.getName() == pk.getName()) {
                          pkSQLName = it.getSQLAccessName(false,"") }
                        }
                      pks = pks + pkSQLName + ","
                    }
                    if (pks != "") {
                      pks =  pks.substring(0, pks.size()-1)
                      ddl = ddl + "PRIMARY KEY(" + pks + ")"
                    } else {
                      ddl =  ddl.substring(0, ddl.size()-2)
                    }
                    return ddl
                }

                MapPhysicalNode getTargetNode() {
                    List<MapPhysicalNode> targetNodes = physicalNode.getDownstreamConnectedNodes() ;
                    if (targetNodes == null || targetNodes.isEmpty()) {
                        throw new RuntimeException("No target node");
                    }
                    MapPhysicalNode targetNode = targetNodes.get(0);
                    return targetNode
                }

                AbstractSyntaxTree INSERT (SqlQuery sqlQuery) {

                    MapPhysicalNode sourceNode = getSourceNode();
                    MapPhysicalNode targetNode = getTargetNode();

                    String sourceSchema = '<%=odiRef.getSchemaName("' + sourceSchemaName + '", "D")%>';
                    String region = '<%=odiRef.getDataServerPropertyFromLSchema( "Region", "' + sourceSchemaName + '")%>'
                    String tenant = '<%=odiRef.getDataServerPropertyFromLSchema( "Tenant Name", "' + sourceSchemaName + '")%>'
                    String sourceLocation = "https://swiftobjectstorage." + region + ".oraclecloud.com/v1/" + tenant + "/" + sourceSchema

                    String targetLocation = physicalNode.getExecutionUnit().getLocation().getLogicalSchema().getName();
                    String targetSchema = '<%=odiRef.getSchemaName("' + targetLocation + '", "D")%>';

                    String targetResourceName = targetNode.getLogicalComponent().getBoundDataStore().getResourceName()
                    String targetDataStore = '<?=odiRef.getObjectShortName("L", "' + targetResourceName + '", "D")?>'

                    if (fileFormat.equals("")) {fileFormat = "CSV";}
                    if (fieldSeparator.equals("")) {fieldSeparator = ",";}
                    String recordSeparator = "newline";
                    String textDelimiter = ""
                    int skipHeaders = 0;

		    if (customUnloadFieldSeparator != null && !customUnloadFieldSeparator.equals("")) {
		      fileFormat = "D";
		      fieldSeparator = customUnloadFieldSeparator;
		    }

                    if (sourceNode.isAPNode() && sourceNode.getLKM().getName().contains("LKM File to Object Storage")) {
                        sourceNode = getSourceNode(sourceNode);
                    }

                    if (!sourceNode.isAPNode() &&
                        (sourceNode.getExecutionUnit().getExecutionTechnology().getName().equals("File") ||
                         sourceNode.getExecutionUnit().getExecutionTechnology().getName().equals("Oracle Object Storage"))) {

                         OdiDataStore sourceDataStore = (OdiDataStore)sourceNode.getLogicalComponent().getBoundObject();

			 if (sourceNode.getExecutionUnit().getExecutionTechnology().getName().equals("File")) {
			    fileFormat = sourceDataStore.getFileDescriptor().getFormatString();
			 } else {
			    String fileStorageFormat = sourceDataStore.getTableFormatType().getName();
			    if (fileStorageFormat.equals("DELIMITED")) { fileFormat = "D"; }
			    if (fileStorageFormat.equals("FIXED")) { fileFormat = "F"; }
			 }

			 String delimitedOption = getOptionValue("DELIMITED_FILE_FORMAT");
                         if (fileFormat == "D" && delimitedOption == "CSV") {
                           fileFormat = delimitedOption;
                         }

                         skipHeaders = sourceDataStore.getFileDescriptor().getSkipHeadingLines();
                         fieldSeparator = sourceDataStore.getFileDescriptor().getFieldSeparator();
                         recordSeparator = sourceDataStore.getFileDescriptor().getRowSeparator();
                         textDelimiter = sourceDataStore.getFileDescriptor().getTextDelimiter();
                    }

                    List<String> resourceList = getResourceList(resourceName);

                    String fieldList = "";
                    String generateFileds = getOptionValue("GENERATE_FIELD_LIST");
                    if (fileFormat.equals("F")) { generateFileds = 'true' }

                    if (generateFileds == 'true') {
                      if (getOptionValue("OVERWRITE_FIELD_LIST") != "" && getOptionValue("OVERWRITE_FIELD_LIST") != null) {
                        fieldList = getOptionValue("OVERWRITE_FIELD_LIST");
                      } else {
                        if (!sourceNode.isAPNode()) {
                          if (fileFormat.equals("F")) {
                            fieldList = getColDefsFixed(sourceNode, targetNode.getExecutionUnit().getExecutionTechnology());
                          } else {
                            fieldList = getColNames(sourceNode, targetNode.getExecutionUnit().getExecutionTechnology());
                          }
                        }
                      }
                    }

                    String formatPropertiesPlus = getOptionValue("ADD_FORMAT_PROPERTIES");
                    if (formatPropertiesPlus == null) {formatPropertiesPlus = "";}

                    CopyDataDirectADWC copyDataStatement = new CopyDataDirectADWC(targetDataStore,
                                                                      targetSchema,
                                                                      credName,
                                                                      resourceList,
                                                                      sourceLocation,
                                                                      fileFormat,
                                                                      skipHeaders,
                                                                      fieldSeparator,
                                                                      recordSeparator,
                                                                      textDelimiter,
                                                                      fieldList,
                                                                      formatProperties,
                                                                      formatPropertiesPlus);

                    copyDataStatement.setIsPushFromSource(false);
                    return copyDataStatement;
                }
